BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "base_kluisjesrv" (
	"id"	integer NOT NULL,
	"kluisnummer"	varchar(200) NOT NULL,
	"naamvoluit"	varchar(200) NOT NULL,
	"gender"	varchar(200) NOT NULL,
	"email"	varchar(200) NOT NULL,
	"userid"	varchar(200) NOT NULL,
	"kluisje"	varchar(200) NOT NULL,
	"kastje"	varchar(18) NOT NULL,
	"topic"	varchar(18) NOT NULL,
	"col"	varchar(18) NOT NULL,
	"row"	varchar(18) NOT NULL,
	"verhuurd"	bool NOT NULL,
	"label"	varchar(18) NOT NULL,
	"type"	varchar(18) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
